class Form_M: public dolfin::Form
{
public:

  // Constructor
  Form_M(std::shared_ptr<const dolfin::Mesh> mesh):
    dolfin::Form(0, 2), uh(*this, 0), u(*this, 1)
  {
    _mesh = mesh;
    _ufc_form = std::make_shared<const multimeshh10norm_form_0>();
  }

  // Constructor
  Form_M(std::shared_ptr<const dolfin::Mesh> mesh, std::shared_ptr<const dolfin::GenericFunction> uh, std::shared_ptr<const dolfin::GenericFunction> u):
    dolfin::Form(0, 2), uh(*this, 0), u(*this, 1)
  {
    _mesh = mesh;
    this->uh = uh;
    this->u = u;

    _ufc_form = std::make_shared<const multimeshh10norm_form_0>();
  }

  // Destructor
  ~Form_M()
  {}

  /// Return the number of the coefficient with this name
  virtual std::size_t coefficient_number(const std::string& name) const
  {
    if (name == "uh")
      return 0;
    else if (name == "u")
      return 1;

    dolfin::dolfin_error("generated code for class Form",
                         "access coefficient data",
                         "Invalid coefficient");
    return 0;
  }

  /// Return the name of the coefficient with this number
  virtual std::string coefficient_name(std::size_t i) const
  {
    switch (i)
    {
    case 0:
      return "uh";
    case 1:
      return "u";
    }

    dolfin::dolfin_error("generated code for class Form",
                         "access coefficient data",
                         "Invalid coefficient");
    return "unnamed";
  }

  // Typedefs
  typedef Form_M_FunctionSpace_0 CoefficientSpace_uh;
  typedef Form_M_FunctionSpace_1 CoefficientSpace_u;

  // Coefficients
  dolfin::CoefficientAssigner uh;
  dolfin::CoefficientAssigner u;
};

